INSERT INTO `pricing_policy` (`id`, `description`, `status`, `add_by`, `add_date_time`, `update_date_time`, `update_history`, `slug`, `is_delete`) VALUES
(1, '<p><span style=\"font-size:18px\">&nbsp;<strong>Introduction</strong></span></p>\r\n\r\n<p>Knowledge Wave India is committed to providing high-quality educational content and services. This pricing policy outlines the structure, criteria, and guidelines for the pricing of our courses, subscriptions, and other educational services. Our aim is to maintain transparency, fairness, and accessibility for all our users.</p>\r\n\r\n<p>&nbsp;Pricing Structure*</p>\r\n\r\n<p><strong>Courses</strong><br />\r\n&nbsp; &nbsp;- *Individual Courses*: Priced based on content complexity, course length, and market demand.<br />\r\n&nbsp; &nbsp;- *Certification Courses*: Include additional fees for certification exams and materials.<br />\r\n&nbsp; &nbsp;- *Workshops and Seminars*: Priced based on duration, speaker credentials, and materials provided.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Custom Packages</strong><br />\r\n&nbsp; &nbsp;- *Corporate Training*: Custom pricing based on company size, training scope, and duration.<br />\r\n&nbsp; &nbsp;- *Educational Institutions*: Special pricing for bulk enrollments and long-term partnerships.</p>\r\n\r\n<p>&nbsp;<strong>Discounts and Promotions</strong></p>\r\n\r\n<p>a. <strong>Early Bird Discounts</strong>: Offered for early registrations in new courses and workshops.<br />\r\nb. <strong>Seasonal Promotions</strong>: Special discounts during festive seasons and educational events.<br />\r\nc. <strong>Referral Program</strong>: Discounts for users who refer new customers.<br />\r\nd. <strong>Student and Educator Discounts</strong>: Special rates for students and educators with valid ID proof.</p>\r\n\r\n<p>4. <strong>Payment Terms</strong></p>\r\n\r\n<p>a. <strong>Payment Methods</strong>: Acceptable methods include credit/debit cards, net banking, and digital wallets.<br />\r\nb. <strong>Payment Schedules</strong>: Subscription payments are due at the start of each billing cycle. One-time course fees are due at registration.<br />\r\nc. <strong>Installment Plans</strong>: Available for select high-value courses and programs.</p>\r\n\r\n<p>*5. <strong>Refund and Cancellation Policy</strong></p>\r\n\r\n<p>a. <strong>Refund Eligibility</strong>: Refunds available within the first 7 days of course enrollment if less than 20% of the content has been accessed.<br />\r\nb. <strong>Subscription Cancellations</strong>: Can be cancelled at any time. Users will retain access until the end of the current billing period.<br />\r\nc. <strong>Course Cancellations</strong>: If a course is cancelled by Knowledge Wave India, a full refund will be issued.</p>\r\n\r\n<p>6. <strong>Price Adjustments</strong></p>\r\n\r\n<p>a. <strong>Periodic Review</strong>: Prices are reviewed periodically to ensure competitiveness and alignment with market trends.<br />\r\nb. <strong>Notice of Changes</strong>: Users will be notified of any price changes at least 30 days in advance.</p>\r\n\r\n<p>7.<strong> Compliance and Dispute Resolution</strong></p>\r\n\r\n<p>a.&nbsp;<strong>Compliance</strong>: All pricing practices comply with relevant laws and regulations.<br />\r\nb. <strong>Dispute Resolution</strong>: Any pricing disputes will be resolved through our customer support team. Unresolved issues may be escalated to higher authorities within Knowledge Wave India.</p>', 1, 6, NULL, '2024-07-13 15:26:40', NULL, NULL, 0);
INSERT INTO `privacy_policy` (`id`, `description`, `status`, `add_by`, `add_date_time`, `update_date_time`, `update_history`, `slug`, `is_delete`) VALUES
(1, '<p><span style=\"font-size:24px\"><strong>Privacy Policy</strong></span></p>\r\n\r\n<p>This Privacy Policy describes Our policies and procedures on the collection, use and disclosure of Your information when You use the Service and tells You about Your privacy rights and how the law protects You.</p>\r\n\r\n<p>We use Your Personal data to provide and improve the Service. By using the Service, You agree to the collection and use of information in accordance with this Privacy Policy.</p>\r\n\r\n<h2>Interpretation and Definitions</h2>\r\n\r\n<h3>Interpretation</h3>\r\n\r\n<p>The words of which the initial letter is capitalized have meanings defined under the following conditions. The following definitions shall have the same meaning regardless of whether they appear in singular or in plural.</p>\r\n\r\n<h3>Definitions</h3>\r\n\r\n<p>For the purposes of this Privacy Policy:</p>\r\n\r\n<p><strong>Account</strong>&nbsp;means a unique account created for You to access our Service or parts of our Service.</p>\r\n\r\n<p><strong>Company</strong>&nbsp;(referred to as either &quot;the Company&quot;, &quot;We&quot;, &quot;Us&quot; or &quot;Our&quot; in this Agreement) refers to KNOWLEDGE WAVE INDIA.</p>\r\n\r\n<p><strong>Cookies</strong>&nbsp;are small files that are placed on Your computer, mobile device or any other device by a website, containing the details of Your browsing history on that website among its many uses.</p>\r\n\r\n<p><strong>Country</strong>&nbsp;refers to: Delhi, India</p>\r\n\r\n<p><strong>Device</strong>&nbsp;means any device that can access the Service such as a computer, a cellphone or a digital tablet.</p>\r\n\r\n<p><strong>Personal Data</strong>&nbsp;is any information that relates to an identified or identifiable individual.</p>\r\n\r\n<p><strong>Service</strong>&nbsp;refers to the Website.</p>\r\n\r\n<p><strong>Service Provider</strong>&nbsp;means any natural or legal person who processes the data on behalf of the Company. It refers to third-party companies or individuals employed by the Company to facilitate the Service, to provide the Service on behalf of the Company, to perform services related to the Service or to assist the Company in analyzing how the Service is used.</p>\r\n\r\n<p><strong>Usage Data</strong>&nbsp;refers to data collected automatically, either generated by the use of the Service or from the Service infrastructure itself (for example, the duration of a page visit).</p>\r\n\r\n<p><strong>Website</strong>&nbsp;refers to KNOWLEDGE WAVE INDIA, accessible from&nbsp;<a href=\"https://knowledgewaveindia.com/WWW.KNOWLEDGEWAVEINDIA.COM\">WWW.KNOWLEDGEWAVEINDIA.COM</a></p>\r\n\r\n<p><strong>You</strong>&nbsp;means the individual accessing or using the Service, or the company, or other legal entity on behalf of which such individual is accessing or using the Service, as applicable.</p>\r\n\r\n<h2>&nbsp;</h2>\r\n\r\n<h4><strong><em>Personal Data</em></strong></h4>\r\n\r\n<p>While using Our Service, We may ask You to provide Us with certain personally identifiable information that can be used to contact or identify You. Personally identifiable information may include, but is not limited to:</p>\r\n\r\n<p>Email address</p>\r\n\r\n<p>First name and last name</p>\r\n\r\n<p>Phone number</p>\r\n\r\n<p>Address, State, Province, ZIP/Postal code, City</p>\r\n\r\n<p>Usage Data</p>\r\n\r\n<h4><em>Usage Data</em></h4>\r\n\r\n<p>Usage Data is collected automatically when using the Service.</p>\r\n\r\n<p>Usage Data may include information such as Your Device&#39;s Internet Protocol address (e.g. IP address), browser type, browser version, the pages of our Service that You visit, the time and date of Your visit, the time spent on those pages, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>When You access the Service by or through a mobile device, We may collect certain information automatically, including, but not limited to, the type of mobile device You use, Your mobile device unique ID, the IP address of Your mobile device, Your mobile operating system, the type of mobile Internet browser You use, unique device identifiers and other diagnostic data.</p>\r\n\r\n<p>We may also collect information that Your browser sends whenever You visit our Service or when You access the Service by or through a mobile device.</p>\r\n\r\n<h4><em>Tracking Technologies and Cookies</em></h4>\r\n\r\n<p>We use Cookies and similar tracking technologies to track the activity on Our Service and store certain information. Tracking technologies used are beacons, tags, and scripts to collect and track information and to improve and analyze Our Service. The technologies We use may include:</p>\r\n\r\n<ul>\r\n	<li><strong>Cookies or Browser Cookies.</strong>&nbsp;A cookie is a small file placed on Your Device. You can instruct Your browser to refuse all Cookies or to indicate when a Cookie is being sent. However, if You do not accept Cookies, You may not be able to use some parts of our Service. Unless you have adjusted Your browser setting so that it will refuse Cookies, our Service may use Cookies.</li>\r\n	<li><strong>Web Beacons.</strong>&nbsp;Certain sections of our Service and our emails may contain small electronic files known as web beacons (also referred to as clear gifs, pixel tags, and single-pixel gifs) that permit the Company, for example, to count users who have visited those pages or opened an email and for other related website statistics (for example, recording the popularity of a certain section and verifying system and server integrity).</li>\r\n</ul>\r\n\r\n<p>Cookies can be &quot;Persistent&quot; or &quot;Session&quot; Cookies. Persistent Cookies remain on Your personal computer or mobile device when You go offline, while Session Cookies are deleted as soon as You close Your web browser. You can learn more about cookies on&nbsp;<a href=\"https://www.termsfeed.com/blog/cookies/#What_Are_Cookies\">TermsFeed website</a>&nbsp;article.</p>\r\n\r\n<p>We use both Session and Persistent Cookies for the purposes set out below:</p>\r\n\r\n<p><strong>Necessary / Essential Cookies</strong></p>\r\n\r\n<p>Type: Session Cookies</p>\r\n\r\n<p>Administered by: Us</p>\r\n\r\n<p>Purpose: These Cookies are essential to provide You with services available through the Website and to enable You to use some of its features. They help to authenticate users and prevent fraudulent use of user accounts. Without these Cookies, the services that You have asked for cannot be provided, and We only use these Cookies to provide You with those services.</p>\r\n\r\n<p><strong>Cookies Policy / Notice Acceptance Cookies</strong></p>\r\n\r\n<p>Type: Persistent Cookies</p>\r\n\r\n<p>Administered by: Us</p>\r\n\r\n<p>Purpose: These Cookies identify if users have accepted the use of cookies on the Website.</p>\r\n\r\n<p><strong>Functionality Cookies</strong></p>\r\n\r\n<p>Type: Persistent Cookies</p>\r\n\r\n<p>Administered by: Us</p>\r\n\r\n<p>Purpose: These Cookies allow us to remember choices You make when You use the Website, such as remembering your login details or language preference. The purpose of these Cookies is to provide You with a more personal experience and to avoid You having to re-enter your preferences every time You use the Website.</p>\r\n\r\n<p>For more information about the cookies we use and your choices regarding cookies, please visit our Cookies Policy or the Cookies section of our Privacy Policy.</p>\r\n\r\n<h3>Use of Your Personal Data</h3>\r\n\r\n<p>The Company may use Personal Data for the following purposes:</p>\r\n\r\n<p><strong>To provide and maintain our Service</strong>, including to monitor the usage of our Service.</p>\r\n\r\n<p><strong>To manage Your Account:</strong>&nbsp;to manage Your registration as a user of the Service. The Personal Data You provide can give You access to different functionalities of the Service that are available to You as a registered user.</p>\r\n\r\n<p><strong>For the performance of a contract:</strong>&nbsp;the development, compliance and undertaking of the purchase contract for the products, items or services You have purchased or of any other contract with Us through the Service.</p>\r\n\r\n<p><strong>To contact You:</strong>&nbsp;To contact You by email, telephone calls, SMS, or other equivalent forms of electronic communication, such as a mobile application&#39;s push notifications regarding updates or informative communications related to the functionalities, products or contracted services, including the security updates, when necessary or reasonable for their implementation.</p>\r\n\r\n<p><strong>To provide You</strong>&nbsp;with news, special offers and general information about other goods, services and events which we offer that are similar to those that you have already purchased or enquired about unless You have opted not to receive such information.</p>\r\n\r\n<p><strong>To manage Your requests:</strong>&nbsp;To attend and manage Your requests to Us.</p>\r\n\r\n<p><strong>For business transfers:</strong>&nbsp;We may use Your information to evaluate or conduct a merger, divestiture, restructuring, reorganization, dissolution, or other sale or transfer of some or all of Our assets, whether as a going concern or as part of bankruptcy, liquidation, or similar proceeding, in which Personal Data held by Us about our Service users is among the assets transferred.</p>\r\n\r\n<p><strong>For other purposes</strong>: We may use Your information for other purposes, such as data analysis, identifying usage trends, determining the effectiveness of our promotional campaigns and to evaluate and improve our Service, products, services, marketing and your experience.</p>\r\n\r\n<p>We may share Your personal information in the following situations:</p>\r\n\r\n<ul>\r\n	<li><strong>With Service Providers:</strong>&nbsp;We may share Your personal information with Service Providers to monitor and analyze the use of our Service, to contact You.</li>\r\n	<li><strong>For business transfers:</strong>&nbsp;We may share or transfer Your personal information in connection with, or during negotiations of, any merger, sale of Company assets, financing, or acquisition of all or a portion of Our business to another company.</li>\r\n	<li><strong>With Affiliates:</strong>&nbsp;We may share Your information with Our affiliates, in which case we will require those affiliates to honor this Privacy Policy. Affiliates include Our parent company and any other subsidiaries, joint venture partners or other companies that We control or that are under common control with Us.</li>\r\n	<li><strong>With business partners:</strong>&nbsp;We may share Your information with Our business partners to offer You certain products, services or promotions.</li>\r\n	<li><strong>With other users:</strong>&nbsp;when You share personal information or otherwise interact in the public areas with other users, such information may be viewed by all users and may be publicly distributed outside.</li>\r\n	<li><strong>With Your consent</strong>: We may disclose Your personal information for any other purpose with Your consent.</li>\r\n</ul>\r\n\r\n<h3>Retention of Your Personal Data</h3>\r\n\r\n<p>The Company will retain Your Personal Data only for as long as is necessary for the purposes set out in this Privacy Policy. We will retain and use Your Personal Data to the extent necessary to comply with our legal obligations (for example, if we are required to retain your data to comply with applicable laws), resolve disputes, and enforce our legal agreements and policies.</p>\r\n\r\n<p>The Company will also retain Usage Data for internal analysis purposes. Usage Data is generally retained for a shorter period of time, except when this data is used to strengthen the security or to improve the functionality of Our Service, or We are legally obligated to retain this data for longer time periods.</p>\r\n\r\n<h3>Transfer of Your Personal Data</h3>\r\n\r\n<p>Your information, including Personal Data, is processed at the Company&#39;s operating offices and in any other places where the parties involved in the processing are located. It means that this information may be transferred to &mdash; and maintained on &mdash; computers located outside of Your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from Your jurisdiction.</p>\r\n\r\n<p>Your consent to this Privacy Policy followed by Your submission of such information represents Your agreement to that transfer.</p>\r\n\r\n<p>The Company will take all steps reasonably necessary to ensure that Your data is treated securely and in accordance with this Privacy Policy and no transfer of Your Personal Data will take place to an organization or a country unless there are adequate controls in place including the security of Your data and other personal information.</p>\r\n\r\n<h3>Delete Your Personal Data</h3>\r\n\r\n<p>You have the right to delete or request that We assist in deleting the Personal Data that We have collected about You.</p>\r\n\r\n<p>Our Service may give You the ability to delete certain information about You from within the Service.</p>\r\n\r\n<p>You may update, amend, or delete Your information at any time by signing in to Your Account, if you have one, and visiting the account settings section that allows you to manage Your personal information. You may also contact Us to request access to, correct, or delete any personal information that You have provided to Us.</p>\r\n\r\n<p>Please note, however, that We may need to retain certain information when we have a legal obligation or lawful basis to do so.</p>\r\n\r\n<h3>Disclosure of Your Personal Data</h3>\r\n\r\n<h4><em>Business Transactions</em></h4>\r\n\r\n<p>If the Company is involved in a merger, acquisition or asset sale, Your Personal Data may be transferred. We will provide notice before Your Personal Data is transferred and becomes subject to a different Privacy Policy.</p>\r\n\r\n<h4><em>Law enforcement</em></h4>\r\n\r\n<p>Under certain circumstances, the Company may be required to disclose Your Personal Data if required to do so by law or in response to valid requests by public authorities (e.g. a court or a government agency).</p>\r\n\r\n<h4><em>Other legal requirements</em></h4>\r\n\r\n<p>The Company may disclose Your Personal Data in the good faith belief that such action is necessary to:</p>\r\n\r\n<ul>\r\n	<li>Comply with a legal obligation</li>\r\n	<li>Protect and defend the rights or property of the Company</li>\r\n	<li>Prevent or investigate possible wrongdoing in connection with the Service</li>\r\n	<li>Protect the personal safety of Users of the Service or the public</li>\r\n	<li>Protect against legal liability</li>\r\n</ul>\r\n\r\n<h3>Security of Your Personal Data</h3>\r\n\r\n<p>The security of Your Personal Data is important to Us, but remember that no method of transmission over the Internet, or method of electronic storage is 100% secure. While We strive to use commercially acceptable means to protect Your Personal Data, We cannot guarantee its absolute security.</p>\r\n\r\n<h2>Children&#39;s Privacy</h2>\r\n\r\n<p>Our Service does not address anyone under the age of 13. We do not knowingly collect personally identifiable information from anyone under the age of 13. If You are a parent or guardian and You are aware that Your child has provided Us with Personal Data, please contact Us. If We become aware that We have collected Personal Data from anyone under the age of 13 without verification of parental consent, We take steps to remove that information from Our servers.</p>\r\n\r\n<p>If We need to rely on consent as a legal basis for processing Your information and Your country requires consent from a parent, We may require Your parent&#39;s consent before We collect and use that information.</p>\r\n\r\n<h2>Links to Other Websites</h2>\r\n\r\n<p>Our Service may contain links to other websites that are not operated by Us. If You click on a third party link, You will be directed to that third party&#39;s site. We strongly advise You to review the Privacy Policy of every site You visit.</p>\r\n\r\n<p>We have no control over and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</p>\r\n\r\n<h2>Changes to this Privacy Policy</h2>\r\n\r\n<p>We may update Our Privacy Policy from time to time. We will notify You of any changes by posting the new Privacy Policy on this page.</p>\r\n\r\n<p>We will let You know via email and/or a prominent notice on Our Service, prior to the change becoming effective and update the &quot;Last updated&quot; date at the top of this Privacy Policy.</p>\r\n\r\n<p>You are advised to review this Privacy Policy periodically for any changes. Changes to this Privacy Policy are effective when they are posted on this page.</p>', 1, 6, NULL, '2024-07-13 15:18:49', NULL, NULL, 0);
