(193248, 0, NULL, NULL, NULL, NULL, 0, 'rosemary-hair-oil-ayurveda-natural-hair-growth-scalp-nourishment-shivved-pvt-ltd', 'Rosemary Hair Oil Ayurveda - Natural Hair Growth & Scalp Nourishment | Shivved Pvt Ltd', '<p>Discover the power of <strong>Rosemary Hair Oil</strong> Ayurveda by <strong>Shivved Pvt Ltd</strong>. Our <strong>100% natural formula promotes hair growth</strong>, strengthens roots, and nourishes the scalp. Rich in antioxidants and essential nutrients, this Ayurvedic remedy revitalizes hair, reduces dandruff, and prevents hair fall. Experience the essence of nature and Ayurveda combined in one powerful bottle. Perfect for all hair types. Buy now for healthy, luscious hair!</p>\n<!---->', 'Shivveda Private Limited', 'Health & Beauty > Personal Care > Hair Care', NULL, 'Kaya Trim Fat Cutter with Green Tea | Natural Fat Burner', '1', 'Title', 'Default Title', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '200', 'shopify', '484', 'deny', 'manual', '499', '999', '1', '0', NULL, 'https://cdn.shopify.com/s/files/1/0647/0297/2042/files/RosemaryHairoil01.jpg?v=1719583389', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'unisex', NULL, 'g', NULL, '499', '1', NULL, NULL, '1', NULL, NULL),
