INSERT INTO `refund_policy` (`id`, `description`, `status`, `add_by`, `add_date_time`, `update_date_time`, `update_history`, `slug`, `is_delete`) VALUES
(1, '<p>.</p>\r\n\r\n<p><strong>Refund Policy</strong><br />\r\nOur commitment at Knowledge Wave India is to ensure your satisfaction and success in your learning journey. With this in mind. Customers can request a refund within 24 hours of the original transaction. However, please be advised that refund requests will not be entertained after this 24-hour period. Refunds are subject to deductions, including a payment gateway fee of 2% and a processing fee of 5%, both calculated based on the paid amount.<br />\r\n<br />\r\n<strong>Disclaimer</strong>: Our company strictly adheres to the 24-hour refund window, and any refund requests received beyond this timeframe will not be processed. We appreciate your understanding of our policy.<br />\r\n<br />\r\n<strong>Refund Process</strong>: To request a refund, please follow these steps: - Email: Send a refund request to knowledgewaveindia@gmail.com from your registered e-mail ID.&nbsp;<br />\r\nInclude the following details:-<br />\r\nFull Name -<br />\r\nRegistered e-mail ID -<br />\r\nRegistration date -<br />\r\nScreenshot of Payment Invoice with date and time (received via email/message upon payment) -<br />\r\nReason for refund</p>', 1, 6, NULL, '2024-07-13 15:15:20', NULL, NULL, 0);
